(188, '', 'C''est trois filles qui ne savent pas faire l''amour, alors y a une des trois filles qui demande à sa mère si le soir elles peuvent faire l''amour. La mère dit oui, donc les trois filles vont sur le chat d''un site internet et passent des petites annonces.\r\nLe soir elles eurent trois réponses et le lendemain les trois garçons se rendent chez elles et ils vont dans leurs chambres respectives, alors la mère monte voir si tout se passe bien et écoute à la première porte et elle entend "aie aie!!!" et à la deuxième "hi hi hi!!!" et à la troisième elle n''entend rien.\r\nLe lendemain elle demande aux trois filles comment c''était déroulé leur soirée, la première répond : une petite foufoune et un gros zizi, ça fait mal, la deuxième répond un petit zizi et une grosse foufoune, ça chatouille et la troisième dit on ne parle pas la bouche pleine !', '', '', '2013-06-17 20:51:51', NULL, 'Public', 'Flootz5959'),
